import React, { Component, Fragment } from "react";

import CheckIn from './CheckIn';
import Search from './Search';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {nextpage : ""};
    this.homeNav = this.homeNav.bind(this);
  }

  homeNav(page) {
    const home = <div>
                   <button type="button" onClick={this.setState({nextpage : "check-in"})}>New Check-in</button>
                   <p></p>
                   <button type="button" onClick={this.setState({nextpage : "search"})}>New Search</button>
                 </div>

    switch(page) {
      case "check-in":
        return <CheckIn/>
      case "search":
        return <Search/>
      default:
        return home
    }
  }

  render() {
    return(
      <div>
        {this.homeNav(this.state.nextpage)}
      </div>
    );
  }
}

export default App;
